import Input from "./common/input";
import PageHeader from "./common/pageHeader";

const SignIn = () => {
   return (
      <>
         <PageHeader title={"Sign In"} />
         <form>
            <Input
               {...getFieldProps("email")}
               label={"Email"}
               type={"email"}
               required
            />
            <Input
               {...getFieldProps("password")}
               label={"Password"}
               type={"password"}
               required
            />
            <button disabled={!form.isValid} className="btn btn-primary mt-2">
               Submit{" "}
            </button>
         </form>
      </>
   );
};

export default SignIn;
